import React from 'react';

class LoginMenu extends React.Component {
    constructor(props) {
        super(props);
        this.handleAppStateChange = this.handleAppStateChange.bind(this);
    }

    handleAppStateChange() {
        this.props.onAppStateChange('CreateAccount');
    }

    render() {

        return <div className="CreateAccountBtn MenuBtn" onClick={this.handleAppStateChange}> Create Account </div>;
    }
}

export default LoginMenu;
